import { useState } from "react";
import toast from "react-hot-toast";
import axios from "../../utils/axios";
import PublicLayout from "../../components/layout/PublicLayout";

const AgencyRegister = () => {
  const [loading, setLoading] = useState(false);

  const [form, setForm] = useState({
    username: "",
    email: "",
    password: "",
    agencyName: "",
    phone: "",
    website: "",
    country: "",
    city: "",
    about: "",
  });

  const handleChange = (e) => {
    setForm((p) => ({ ...p, [e.target.name]: e.target.value }));
  };

  const submit = async (e) => {
    e.preventDefault();

    try {
      setLoading(true);

      const res = await axios.post("/agencies/register", form);

      toast.success(res.data?.message || "Agency registered successfully");

      // OPTIONAL: redirect
      // navigate("/login");
    } catch (err) {
      toast.error(err.response?.data?.message || "Registration failed");
    } finally {
      setLoading(false);
    }
  };

  return (
    <PublicLayout>
      <div className="container" style={{ maxWidth: 800 }}>
        <h2 className="mb-4">Register as Agency / Agent</h2>

        <form onSubmit={submit} className="row g-3">
          <div className="col-md-6">
            <label>Username *</label>
            <input
              name="username"
              required
              className="form-control"
              onChange={handleChange}
            />
          </div>

          <div className="col-md-6">
            <label>Email *</label>
            <input
              type="email"
              name="email"
              required
              className="form-control"
              onChange={handleChange}
            />
          </div>

          <div className="col-md-6">
            <label>Password *</label>
            <input
              type="password"
              name="password"
              required
              className="form-control"
              onChange={handleChange}
            />
          </div>

          <div className="col-md-6">
            <label>Agency Name *</label>
            <input
              name="agencyName"
              required
              className="form-control"
              onChange={handleChange}
            />
          </div>

          <div className="col-md-6">
            <label>Phone</label>
            <input
              name="phone"
              className="form-control"
              onChange={handleChange}
            />
          </div>

          <div className="col-md-6">
            <label>Website</label>
            <input
              name="website"
              placeholder="https://"
              className="form-control"
              onChange={handleChange}
            />
          </div>

          <div className="col-md-6">
            <label>Country</label>
            <input
              name="country"
              className="form-control"
              onChange={handleChange}
            />
          </div>

          <div className="col-md-6">
            <label>City</label>
            <input
              name="city"
              className="form-control"
              onChange={handleChange}
            />
          </div>

          <div className="col-md-12">
            <label>About the Agency</label>
            <textarea
              name="about"
              rows={4}
              className="form-control"
              onChange={handleChange}
            />
          </div>

          <div className="col-md-12 mt-3">
            <button className="btn btn-dark w-100" disabled={loading}>
              {loading ? "Submitting..." : "Submit Agency Registration"}
            </button>
          </div>
        </form>
      </div>
    </PublicLayout>
  );
};

export default AgencyRegister;
